INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(29, 'Politics', 'Rising costs of living: The common citizens tell us their perspective', '<b>For several months, Bangladesh has been grappling with a price hike of fuels, foods and other essentials – the apparent consequence of a global inflation. How has the public been faring? What are their thoughts and opinions about the government measures to tackle this economic crisis? The Daily Star asked, and they responded.</b>\r\n\r\n\"[Fuel price hike] has negatively impacted all sectors, particularly the agricultural sector. Farmers are already struggling to break even, and such inconsiderate decisions have made it worse for them. As for producers, if they calculate their production costs only in terms of wages, they will surely incur losses. Most farmers also have other jobs. If they don\'t do farming, the land will remain unutilised. But they also cannot live off of farming alone. The higher price of diesel will also make cultivation, irrigation, and transportation of crops costlier. But farmers cannot increase the prices of their harvest as easily as transport owners can raise transportation fees. Only hoarders can increase the prices of agricultural goods, but not that of raw materials. This is why we often see the heartbreaking scene of fresh vegetables being dumped on the roadside.\"\r\n\r\n- Nazmussakib Sojib\r\n\r\n\"Given that there seems to be no need for the ruling party to get votes from the public to stay in government, they have free reign to do anything they want. Even the police have turned into a force for the ruling party. There is no level of the government, low or high, which is not submerged in corruption. They are using the country\'s people to build lavish lives for themselves abroad. It is the unchecked corruption of government officials that has brought the country to the brink of desperation. Why have oil prices increased in Bangladesh when they are decreasing elsewhere? How will the poor survive? All the government high-ups do is sit in their air-conditioned rooms, increase prices arbitrarily, and think about which projects to steal exorbitant amounts of money from and smuggle it out of the country. They don\'t love Bangladesh – they wish to loot it. And when we try to protest these price hikes, we have to face police batons or even get shot. Every citizen is feeling resentment towards the authorities.\"\r\n\r\n- Mokshudul Momin  ', '2022-08-19 15:55:19', '2022-08-21 19:50:54', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(30, 'Business', 'ICDs now hike container handling charge by 25pc', 'Private inland container depots (ICDs) have raised charges for their services involving handling export-laden containers by 25 per cent citing the August 5 hike in fuel prices. \r\n\r\nThe change was decided upon by Bangladesh Inland Container Depots Association (Bicda) and Bangladesh Freight Forwarders Association (BAFFA) at the latter\'s Dhaka office yesterday.\r\n\r\nThe rise will have a retrospective effect, applicable for services availed since August 6, the day the new fuel prices came into effect.\r\n\r\nBicda earlier said charges for five types of services which required the use of diesel, such as vehicular and equipment operations, needed to be adjusted for the price of each litre of the fuel being increased to Tk 114 from Tk 80.\r\n\r\nAfterwards, it unilaterally raised an import container handling charge by 34 per cent.\r\n\r\nOn Thursday, Bicda sat with Bangladesh Shipping Agents Association to raise an empty container handling charge by 24 per cent.\r\n\r\nHandling export containers involve an export stuffing package and verifying gross mass, said BICDA Secretary General Md Ruhul Amin Sikder.\r\n\r\nThe package involves taking an empty container from a depot yard to its container freight station (CFS), loading goods into the container, taking the loaded container back to the depot yard and transporting it later to the Chattogram port for shipment.\r\n\r\nThe package charge has been raised from Tk 5,092 to Tk 6,365 for 20-foot containers and from Tk 6,790 to Tk 8,488 for 40-foot containers.\r\n\r\nThe charge for verifying the gross mass was raised by Tk 354 to Tk 1,769.\r\n\r\nFreight forwarders usually pay these charges on behalf of international buyers.\r\n\r\nThe Bicda secretary general, however, pointed out that the charges were the maximum an ICD could impose as many individually charge lesser under deals with buyers.\r\n\r\nThe ICD owners wanted to raise both charges by 45 per cent but the Bicda leaders agreed to 25 per cent considering the huge rise in costs and current economic situation, said BAFFA Vice President Khairul Alam Sujan. ', '2022-08-21 20:21:07', '2022-08-21 20:21:07', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(31, 'Technology', 'Musk seeks Twitter spam account info from ad tech companies', 'In the latest development of the lawsuit against Elon Musk\'s refusal to buy Twitter, the tech billionaire has opted to seek documents from advertising technology companies for more information on Twitter\'s bots and spam accounts. \r\n\r\nTwitter has sued the Tesla chief executive, who has accused Twitter of hiding information about how it calculates the percentage of bots on the service, for attempting to walk away from the $44 billion agreement. A trial is scheduled for October 17.\r\n\r\nAccording to recent filings in a Delaware court,  Musk\'s lawyers have subpoenaed both Integral Ad Science (IAS) and DoubleVerify for any documents or communications on their involvement in reviewing accounts or participation in any audit of Twitter\'s user base.\r\n\r\nIAS and DoubleVerify, which are both based in New York, use technology to independently verify that digital ads are viewed by real people. Advertisers use the services to ensure the ads they pay for are seen by potential customers and not automated bots.\r\n\r\nTwitter, IAS and DoubleVerify did not immediately respond to requests for comment.\r\n\r\nIn response to a tweet by a user who questioned how Twitter audits its service and also linked to a Reuters story on Musk targeting the ad firms, Musk tweeted:  \"Those are the questions that Twitter is doing everything possible to avoid answering\".  \r\n\r\nIn a countersuit earlier this month, Musk claimed that Twitter\'s monetizable daily active users are 65 million lower than what the company has touted. Twitter has said it stands by its disclosures.\r\n\r\nThe metric measures users who log onto Twitter through the website or apps that are able to serve ads or used paid products like subscriptions, according to Twitter filings.', '2022-08-21 20:48:40', '2022-08-21 20:48:40', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(33, 'Sports', 'Bangladesh need more head than heart, says Shakib', 'Skipper Shakib Al Hasan warned Bangladesh that they must keep their emotions in check after rivals Sri Lanka dumped them out of the Asia Cup cricket following a bitter war of words.\r\n\r\nSri Lanka won a do-or-die match in Dubai by two wickets and with four balls to spare on Thursday to move into the Super Four stage of the tournament, a prelude to the T20 World Cup.\r\n\r\nBefore the clash the two sides exchanged verbal volleys in media conferences with Sri Lanka captain Dasun Shanaka saying Bangladesh lacked a world-class bowler other than Mustafizur Rahman and Shakib.\r\n\r\nBangladesh team director Khaled Mahmud hit back, saying: \"I don\'t see any (world-class) bowler in Sri Lanka as well... we have at least two.\"\r\n\r\nThe battle of words moved to social media with former Sri Lanka skipper Mahela Jayawardene tweeting: \"Looks like it\'s time for (our) bowlers to show the class and batters to show who they are on the field.\"\r\n\r\nShakib denied after the defeat that ended their Asia Cup hopes that the off-field chatter had affected them, but admitted his Bangladesh team needed to play more with their heads.\r\n\r\n\"We are very emotional. That is the other area we need to improve,\" Shakib said, with the World Cup in Australia on the horizon in October-November.\r\n\r\n\"Keep our emotions on the side and play the way we need to play. More looking to give our head in the game than our heart in the game.\"', '2022-09-02 15:35:11', '2022-09-02 15:35:11', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(34, 'Technology', 'How senior citizens can remain safe from cybercrimes', 'As far as cybercriminals are concerned, we are all fair game. Whether you are young or old, they don\'t discriminate. With the internet reaching into all of our lives every day, cybercriminals have a vast, ever-growing playing field.\r\n\r\nOur senior citizens are becoming increasingly comfortable being online. But as their involvement grows, so does the risk that they will fall victim to cybercrime. There is a good chance that being new to the digital world, seniors are more trusting and less aware of the risks lurking around the corner to catch them unaware.  \r\n\r\nHere are some tips for senior citizens to stay safe and secure online, safeguard their privacy, and prevent them from becoming a victim of cybercrime.\r\n\r\nCreate a strong password \r\nThere is a tendency to develop an easy-to-remember password and use it across platforms. However, this is a big no-no. Strong passwords are necessary. What can help is using a password manager to avoid forgetting login details. \r\n\r\nTwo-factor authentication\r\nWebsites and apps employ a two-step process to validate your identity and credentials. Those less familiar with the internet could find this problematic and decide not to deal with it for fear of making a mistake. At this point, it is essential to have faith in your abilities to protect your personal information. \r\n\r\nBeing vigilant while using emails\r\nEmails asking to reveal your credentials or personal information should be treated with extreme suspicion. This will help to a great extent to protect you from falling for phishing scams. At the same time, adopt a zero-trust attitude when opening emails and never click on links from people you don\'t know.\r\n\r\nAlso, don\'t forget to review your emails for any phishing warning flags carefully. Stop immediately if there are dramatic taglines requesting money transfers or claims of winning a jackpot. Words like \"final notice\", \"two hours left to book\", and similar phrases should be a red flag. Check a sender\'s address - if it differs from what you would anticipate seeing, such as having many random letters or incorrect domain names, delete it immediately. \r\n\r\nOnline payments while ordering food or making payments \r\nCriminals frequently fake legitimate website pages. Be vigilant and look for indicators that the website is fake. Always verify that you have accessed the correct page before placing an order for food or any other goods or making a payment on a website. Verify the legitimacy of the firm\'s logo and whether the secure logo is there (look for a lock symbol in the URL). Avoid visiting sites that have inconsistent logos or slightly misspelled company names. Due to slight alterations, it is practically impossible to tell these pages from genuine pages. However, it\'s important to proceed with prudence.  \r\n\r\nSetting up new passwords – beware of scams\r\nSome websites might prompt users to create a new password, or an incredible offer may persuade them. Always follow the maxim: If it seems too good to be true, it generally is. An entry page for the user\'s username and password will be displayed after clicking the link. Once this information has been provided, hackers can readily access your information. Data from wire transfers, credit card information, or debit card credentials could be included in this information. Avoid falling for this trap. \r\n\r\nUse of QR codes \r\nThe use of QR codes has recently increased, along with QR code fraud. Hackers can gain access to data on your phone through a scan of a fake QR code. While it can be difficult to tell if a QR code is real or not, it is essential to ensure you\'re scanning a QR code from a reliable source. \r\n\r\nUsing social networking sites\r\nMalicious links may also be present on social networking sites and messaging apps. The connections you find in comments on social media postings may have been planted by hackers. \r\n\r\nBe cautious about sharing information publicly using any social media network. Social media platforms are being used by an increasing number of seniors to connect with friends and family. While there is nothing wrong with that, they are unaware of privacy settings. As a senior, it is advisable to understand the dos and don\'ts of social media. Additionally, do not be scared to ask friends and family who are more accustomed to using the internet for help. \r\n\r\nUsing public Wi-Fi networks\r\nUnless unavoidable, refrain from using free Wi-Fi. Hackers gain access to these networks and can then enter your laptop or mobile device. There are secure ways to connect to public Wi-Fi, ideally through a VPN, but if you travel regularly and use public Wi-Fi frequently, be careful to establish a secure connection. \r\n\r\nWith these tips, there are fewer chances of falling victim to a cyberattack, and users can enjoy a safe and secure online experience.', '2022-09-02 15:42:59', '2022-09-02 15:42:59', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(35, 'Business', 'Yellen ‘optimistic’ on deal to set price cap on Russian oil', 'US Treasury Secretary Janet Yellen said Wednesday she was \"optimistic\" about the possibility of an international agreement to set a price limit on Russia\'s oil exports.\r\n\r\n\"I\'m really optimistic about the substantial progress that\'s been made by our teams and the entire G7 for making the price cap a reality,\" Yellen said.\r\n\r\nThe US official met with her British counterpart, Chancellor of the Exchequer Nadhim Zahawi, and noted that \"the United Kingdom has been a key ally in the G7\'s work to put in place a price cap on Russian oil.\"\r\n\r\nThe leaders of the Group of Seven advanced nations agreed in late June to work towards implementing the ceiling on crude sales, to choke off Moscow\'s war chest, as well as bring down global energy prices. wow.\r\n\r\nYellen said the goal is to deny Vladimir Putin the funds to continue the war in Ukraine and to prop up the Russian economy.\r\n\r\nA G7 official late last month explained that the maximum price would remain above the cost of the production, so it would not make economic sense for Moscow to deny oil to importing countries.\r\n\r\n\"We know that there\'s a great deal of room between the price of production, and what Russia is making today,\" the official told reporters. wow', '2022-09-02 15:52:43', '2022-09-02 17:03:06', );
INSERT INTO `news` (`id`, `category`, `headline`, `content`, `create_datetime`, `updated_datetime`, `headIMG`) VALUES
(36, 'Sports', 'How and when to ask for a salary raise: A guide', 'Asking for a raise is still considered one of the most challenging tasks for any employee. But the scene is changing as more people learn there is nothing wrong with requesting a raise that rewards their efforts. However, one must understand the culture of their workplace, how much raise they can ask for, and for what reasons to make a compelling case for a paycheck raise to their employers. Some strategies and best practices will always provide the best outcomes. If you are considering asking for a raise at work, here are the necessary things you should know about it. \r\n\r\nIs it okay to ask for a raise? \r\nAlthough the culture of asking for a raise in traditional and conservative places is not widely practised, changes are coming. Both employees and employers are becoming increasingly aware that often providing a better salary is the better act for everyone. If an employee is underpaid, for instance, it is likely to harm the quality of contribution they could make as they may have more financial pressure and feel underappreciated. \"Asking for a raise demonstrates your self-awareness; it is a sign that you take your career seriously and know your worth,\" says a manager of a leading service company in Bangladesh. \r\n\r\nHow much raise can be requested?\r\n\"How much raise you may ask for really depends heavily on the context in which the raise is being asked,\" says a Head of Branding of a leading financial institution in Bangladesh. He adds, \"Generally, a reasonable ask is within the range of 3-5 percent annually assuming you performed as expected by the Human Resources team, and the company had an overall growth too.\" He explains if a company does not meet their company goal of growth, it may not have enough profit to offer raises to its employees. In contrast, a junior assistant vice president of another leading financial institution says, \"If you have not received a raise in two to three years, and if you have performed consistently well, you may ask for a raise around ten percent.\" An appropriate salary raise request could range from three to ten percent within one to three years, assuming the individual has performed up to expectation and the company is operating on profit.  \r\n\r\nWhen to ask for a raise? \r\nRecognising when you can or should ask for a raise is an important skill to learn. If not asked for, employees may often be kept underpaid by Human Resources teams that do not necessarily follow a regular payment evaluation system. For instance, some companies do not annually review how much they should increase employee payments. This may leave a deserving employee without a raise, even if they deserve it. So they should ask for a raise if their employer is not evaluating their salary increment for a long time. This may vary across workplace types; for instance, one may ask for a raise in a startup within a few months if they receive a grant that allows them to support their employees with better remuneration. In general, an employee should wait at least one annual calendar year before asking for a raise and perhaps should not wait more than three years because, in most cases, inflation and other factors pile up more heavily against their existing salary. \r\n\r\nHow to ask for a raise?\r\nAsking for a raise can be challenging for many, as these discussions are often deemed sensitive. However, despite the inertia that may persist, it is crucial to ask for it. To time it well, you may ask for it after a successful project or a good performance review that will give you an advantage. \"It is best asked directly at the office, at a time of less rush to the relevant person so that they can process your request in a fresh mind,\" says a Head of Marketing of a local healthcare startup. It is essential to stay polite and place the request in a bold but respectful tone. You may point out relevant reasons such as your contribution to the company, inflation or increased cost of living, industry practices etcetera.\r\n\r\nWhat to do if the request is declined?\r\nYour request may still be rejected even if placed perfectly and justifiably. In this case, if you are truly desperate, you may inform the higher authority of the Human Resources department through email. Alternatively, if you feel that your workplace is unjust towards you, you may look into other job openings to see if there is a better fit for you that aligns with your self-worth more. Human Resource personnel at a global development organisation notes, \"You should ask for a raise knowing that it may be rejected, and should be open towards accepting any outcome of the request placed.\" Although the thought of asking for a raise is still not a convention in many places and may be discouraging for lower-level employees, they should consider asking for it if they believe their salary is not fair or adequate. In cases where they feel asking for a raise would put their job in danger, they can still consider asking for it. For example, the employee may be better elsewhere if their employer is not accommodating to basic requests such as salary increments. However, suppose it is a question of sustaining livelihood, and they have no alternative. In that case, the employee may first look for job opportunities elsewhere that offer them an adequate or a more justified salary...', '2022-09-05 15:28:34', '2022-09-10 17:16:51', );

